import { createNativeStackNavigator } from '@react-navigation/native-stack';
import * as React from 'react';
import { Image } from 'react-native'; // Import Image from 'react-native'
import ViewPeopleScreen from '../screens/ViewPeopleScreen';
import Styles from '../styles/MainStyle';
import { imageIndex } from '../constants/images';

const Stack = createNativeStackNavigator();

export default function PeopleNavigator() {
  return (
    <Stack.Navigator
      initialRouteName="ViewPeople"
      screenOptions={{
        headerShown: true,
        headerBackTitle: 'Back',
        headerStyle: Styles.headerBar,
        headerTitleStyle: Styles.headerBarTitle,
        headerTitleAlign: 'center', // Align the title and image at the center
        headerTitle: () => ( // Use a custom headerTitle component
          <Image
            source={'Mobile App\Practice-Mobile-App\assets\images\icon.png'} // Replace 'imageIndex' with your image source
            style={{ width: 40, height: 40 }} // Define width and height of the image
            resizeMode="contain" // Adjust the resizeMode as needed
          />
        ),
      }}>
      <Stack.Screen
        name="ViewPeople"
        component={ViewPeopleScreen}
        options={{ title: 'View All Staff' }}
      />
    </Stack.Navigator>
  );
}
